import { Container } from "react-bootstrap";
import { Link } from "react-router-dom";

const  HeaderLogo= () => {
    return (
        <Container fluid>
            <div className="custom">
                <div className="hw-logo">
                    <Link to={'/'}></Link>
                </div>
            </div>
        </Container>
    );
}

export default HeaderLogo;
